import React from 'react';
import './index.css';


class Portfolio extends React.Component {
    render() {
        return(
            <div id={this.props.id}>
                <div className="col">
                    <div className="card-container">
                        <div className="overlay" />
                        <div className="overlay" />
                        <div className="overlay" />
                        <div className="overlay" />
                        <div className="card">
                            <h4>Name</h4>
                            <span className="chev">&rsaquo;</span>
                        </div>
                    </div>
                </div>
            </div>
        );
    };
};

export default Portfolio;
